import supertest from 'supertest';
import {expect} from 'chai';
import { it } from 'mocha';
import { resource } from 'selenium-webdriver/http';
import payloads from './payloads.js';
var path = require ("./resources.js");
var body = require ("./payloads.js");

console.log(path.domainUrl);

const request = supertest(path.domainUrl);
const token = path.token;
describe("Content apis" , () => {
    it.skip ('GET all details of the content' , (done) => {
            request.get(path.url).end((err,res) =>{
             console.log(res.body);
             console.log(err);
             expect(res.body.result.content).to.not.be.empty;
             done();
          })
        })
// With done call back 
            //request.get('content/v1/read/do_31321401593029427218').then((res) =>{
               // console.log(res.body);
                //console.log(err);
               // expect(res.body.result.content).to.not.be.empty;
               // done();
            //})
        //})
    it ('GET contains channel',(done)=> {
            request.get(path.url).end((_err,res) =>{
            console.log(res.body.result.content.channel);
            expect(res.body.result.content.channel).to.be.equal("01269878797503692810");
            done();

        });
    });

    it ('GET contains identifier',(done)=> {
            const url = 'content/v1/read/do_31321401593029427218';
                request.get(path.url).end((_err,res) =>{
                console.log(res.body.result.content.identifier);
                expect(res.body.result.content.identifier).to.eq("do_31321401593029427218");
                done();
            });
        });

    it ("/POST create user", (done)=> {
           const url = "user/v1/signup";
           const data=  {
            'request'  :{               
              firstName: 'Admin User',
              //email: 'juthikatest_12@yopmail.com', 
             email: `testapi-${Math.floor(Math.random() * 9999)}@yopmail.com`,
              emailVerified: true,
              password:'Test@123'

           }};

        const res = request.post(url)
               .set('Authorization',token)
               .send(body.userCreate)
               .then((res) => {

                console.log(res.body);
                console.log(res.body.result.userId);
                console.log(res.body.result.response);
                let response1= res.body.response;
                    if (response1.to.be.eq("SUCCESS")){

                        console.log("API WORKING FINE");
                    }
                        else console.log("API not working");
                });
            done();

       });

});

